import { Injectable } from "@angular/core";

@Injectable({
    providedIn: "root"
})

export class Ser{
    private propie: any[] = [];

    public setrut(rut: any){
        this.propie.push(`${rut}`)
    }

    public getrut(): any[] {
        return (this.propie)
        
    }
}
